import Vue from 'vue'
import VueRouter from 'vue-router'
import MainPage from '../views/MainPage.vue'


Vue.use(VueRouter)

const routes = [
  {
    path: '/',
    name: 'MainPage',
    component: MainPage
  },
  {
    path: '/dislocation',
    name: 'dislocation',
    component: () => import('../views/Dislocation.vue')
  },
  {
    path: '/transporation',
    name: 'transporation',
    component: () => import('../views/Transporation.vue')
  }
]

const router = new VueRouter({
  mode: 'history',
  base: process.env.BASE_URL,
  routes
})

export default router
